import React from 'react';

import { Link } from 'react-router-dom';

const User = ({ infoUser })  => {
  const {avatar, name, username, } = infoUser;

  return (
    <article className="post">
      <header className="post__header">
        {console.log(avatar,name,username)}
        <Link to={`/users/${username}`}>
        </Link>
      </header>
    </article>
  )
};

export default User;
